INSERT INTO `Faction` VALUES ('ASTRO','Astro-Salvage Alliance','The Astro-Salvage Alliance is a group of scavengers and salvagers who search the galaxy for ancient artifacts and valuable technology, often combing through old ship battlegrounds and derelict space stations.','X1-GV74-81200C'),('CORSAIRS','Seventh Space Corsairs','The Seventh Space Corsairs are a feared group of pirates and raiders who operate throughout the galaxy, preying on merchant ships and plundering valuable cargo.','X1-BF37-49380B'),('COSMIC','Cosmic Engineers','The Cosmic Engineers are a group of highly advanced scientists and engineers who seek to terraform and colonize new worlds, pushing the boundaries of technology and exploration.','X1-DF55-20250Z'),('DOMINION','Stellar Dominion','The Stellar Dominion is a powerful, expansionist faction that seeks to conquer and control as many systems as possible, using their advanced technology and military might to dominate their rivals.','X1-XR17-03350B'),('GALACTIC','Galactic Alliance','The Galactic Alliance is a coalition of planets and factions that have banded together for mutual protection and support, working together to defend against external threats and promote cooperation.','X1-VU95-90460B'),('QUANTUM','Quantum Federation','The Quantum Federation is a group of planets and factions that have joined together to share knowledge and technology, using their collective expertise to advance the science and technology of the galaxy.','X1-SN36-26080C'),('VOID','Voidfarers','The Voidfarers are a group of nomadic traders and adventurers who travel the galaxy in search of riches and adventure, willing to take risks and explore the unknown.','X1-UK8-56510E');
