INSERT INTO `WaypointTrait` VALUES ('BARREN','Barren','A desolate world with little to no vegetation or water, presenting unique challenges for habitation and resource extraction.'),('BUREAUCRATIC','Bureaucratic','A waypoint governed by complex regulations, red tape, and layers of administration, often leading to inefficiencies and frustration.'),('COMMON_METAL_DEPOSITS','Common Metal Deposits','A waypoint rich in common metals like iron, copper, and aluminum, as well as their ores, essential for construction and manufacturing.'),('DRY_SEABEDS','Dry Seabeds','Vast, desolate landscapes that once held oceans, now exposing the remnants of ancient marine life and providing opportunities for the discovery of valuable resources.'),('FROZEN','Frozen','An ice-covered world with frigid temperatures, providing unique research opportunities and resources such as ice water, ammonia ice, and other frozen compounds.'),('HIGH_TECH','High-Tech','A center of innovation and cutting-edge technology, driving progress and attracting skilled individuals from around the galaxy.'),('MARKETPLACE','Marketplace','A thriving center of commerce where traders from across the galaxy gather to buy, sell, and exchange goods.'),('MILITARY_BASE','Military Base','A fortified stronghold housing armed forces, advanced weaponry, and strategic assets for defense or offense.'),('MINERAL_DEPOSITS','Mineral Deposits','Abundant mineral resources, attracting mining operations and providing valuable materials such as iron ore, copper ore, aluminum ore, and quartz sand for various industries.'),('OVERCROWDED','Overcrowded','A waypoint teeming with inhabitants, leading to cramped living conditions and a high demand for resources.'),('PRECIOUS_METAL_DEPOSITS','Precious Metal Deposits','A source of valuable metals like gold, silver, and platinum, as well as their ores, prized for their rarity, beauty, and various applications.'),('SHIPYARD','Shipyard','A bustling hub for the construction, repair, and sale of various spacecraft, from humble shuttles to mighty warships.'),('STRIPPED','Stripped','A waypoint that has been heavily exploited for its resources, leaving a scarred and depleted landscape with diminished opportunities for future development.'),('STRONG_MAGNETOSPHERE','Strong Magnetosphere','A waypoint enveloped in a powerful magnetic field, potentially affecting spacecraft systems, and creating unique phenomena such as the concentration of exotic matter and graviton emitters.'),('TEMPERATE','Temperate','A world with a mild climate and balanced ecosystem, providing a comfortable environment for a variety of life forms and supporting diverse industries.'),('TOXIC_ATMOSPHERE','Toxic Atmosphere','A waypoint with a poisonous atmosphere, necessitating the use of specialized equipment and technology to protect inhabitants and visitors from harmful substances.'),('TRADING_HUB','Trading Hub','A critical junction in the galaxy\'s trade network, with countless goods and services flowing through daily.'),('VIBRANT_AURORAS','Vibrant Auroras','A celestial light show caused by the interaction of charged particles with the waypoint\'s atmosphere, creating a mesmerizing spectacle and attracting tourists from across the galaxy.'),('VOLCANIC','Volcanic','A volatile world marked by intense volcanic activity, creating a hazardous environment with the potential for valuable resource extraction, such as rare metals and geothermal energy.'),('WEAK_GRAVITY','Weak Gravity','A waypoint with a low gravitational pull, providing unique opportunities for research and industry while also challenging the adaptation of life forms and technology.');
/*!40000 ALTER TABLE `WaypointTrait` ENABLE KEYS */;
UNLOCK TABLES;

